script: |
  super -f text -I q6035.spq | sort > q6035.out

inputs:
  - name: q6035.spq
    data: |
      SELECT DISTINCT - + col2 * CAST ( - - col2 AS INTEGER ) AS col1 FROM tab1 (FORMAT parquet) cor0 WHERE ( NULL ) NOT BETWEEN - + col1 AND col2 + + - 0 / - col2;
  - name: tab1

outputs:
  - name: q6035.out
    data: |
